 rate limits.'=>'Svarbu! Atrodo, kad jūsų %1$s konfigūracija viršija šaltinio kalendoriaus teikėjo tarifų ribas.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Jei jūsų kalendoriai neįkeliami tinkamai, peržiūrėkite savo %1$s nustatymus ir naudojimą:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Nenaudokite %1$s savo trumpuosiuose koduose. Ši funkcija skirta tik problemų sprendimui ir neturėtų būti palikta įjungta nuolat.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Padidinkite %1$s %2$sLaikinasis (cache) galiojimo laikas%3$s nustatymą iki %4$s43200%5$s (12 valandų) ar daugiau, kad sumažintumėte užklausų teikėjui dažnį. (Žr. pastabą žemiau.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Venkite įtraukti didelį skaičių (10 ar daugiau) to paties teikėjo informacijos srautų į vieną %1$s trumpąjį kodą.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Laikinai sustabdykite ICS kalendorių savo priekinėse puslapiuose naudodami %1$sSustabdyti kalendorius%2$s įrankį. (Rekomenduojama 24–48 valandos.)','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s turi integruotą talpyklą, skirtą našumui pagerinti ir išvengti paslaugos teikėjo nustatytų ribų viršijimo. Apeinant šią talpyklą ir nustatant labai mažą %2$sperkrovimo%3$s parametrą, kalendoriaus teikėjas gali laikinai užblokuoti jūsų žiniatinklio serverio IP adresą arba visą jūsų prieglobos tinklą.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Atlikę rekomenduojamus pakeitimus, palaukite iki 24 valandų, kol kalendoriaus teikėjas pašalins visus laikinus jūsų IP adreso blokavimus. Jei problema neišsprendžiama, susisiekite su mumis naudodami %1$spagalbos prašymo formą%2$s ir būtinai pridėkite savo %3$ssistemos ataskaitą%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Pastaba: Nustatykite %1$sLaikinojo (keš) galiojimo pabaigą%2$s kuo didesnę, atsižvelgdami į tai, kaip dažnai paprastai atnaujinama informacija apie įvykius jūsų kalendoriuje. %3$s Atminkite, kad prireikus bet kuriuo metu galite naudoti %4$sIšvalyti kalendoriaus keš duomenis%5$s priemonę, kad rankiniu būdu išvalytumėte keš.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sAtkreipkite dėmesį:%2$s %3$s versijoje 10.6 pakeisti kelių trumpųjų kodų nustatymų numatytieji parametrai. Siekiant išlaikyti nuoseklumą, šie nauji numatytieji parametrai %4$sneįjungiami%5$s atnaujinant iš ankstesnės versijos. Jei norite sužinoti daugiau apie pakeitimus, perskaitykite mūsų %6$sblogą%7$s arba, norėdami pereiti prie naujų numatytųjų nustatymų, įjunkite %8$s parinktį %9$s nustatymų%10$s puslapyje.','Use new parameter defaults (v.10.6)'=>'Naudokite naujus parametrų numatytuosius nustatymus (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sAtkreipkite dėmesį:%2$s %3$s versija 11.0 supaprastina ICS srauto URL adresų paiešką. Šis pakeitimas naudoja standartinę įdiegtą WordPress funkciją, todėl turėtų būti visiškai suderinamas su visomis esamomis instaliacijomis. Jei po atnaujinimo iki 11 ar vėlesnės versijos susidursite su naujomis problemomis, kreipkitės pagalbos į %4$sWordPress pagalbos forumus%5$s.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sAtkreipkite dėmesį:%2$s %3$s versijoje 11.5.14.2 įdiegtas naujas, saugesnis kalendoriaus parametrų tvarkymo būdas, kai jie įkeliami per AJAX. Išvalykite visus naudojamus kešavimo įskiepius, kad kalendoriai būtų tinkamai įkelti naudojant naująjį būdą.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sSveiki atvykę į %2$s 12 versiją!%3$s 12.0 versijoje įdiegtos papildomos trikčių šalinimo priemonės, taip pat atlikta nemažai našumo patobulinimų ir sąsajos patobulinimų. Daugiau informacijos apie šį atnaujinimą rasite %4$spokyčių sąraše%5$s.','Getting Started'=>'Pradėkime','Settings'=>'Nustatymai','Appearance'=>'Išvaizda','Utilities'=>'Įrankiai','System Report'=>'Sistemos ataskaita','Support'=>'Palaikymas','Upgrade to %1$s!'=>'Atnaujinkite iki %1$s!','Show/hide all'=>'Rodyti/paslėpti viską','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS failas negalėjo būti atsisiųstas arba buvo tuščias. Patikrinkite, ar URL adresas yra teisingas, ir patikrinkite php.ini konfigūraciją, kad įsitikintumėte, jog cURL arba allow_url_fopen yra prieinami. Jei naudojate tarpus, kad atskirtumėte kelis URL adresus, galite pabandyti vietoj to naudoti vertikaliąją brūkšnį. Paveiktas URL adresas:','Hide past events'=>'Paslėpti praėjusius įvykius','Show past events'=>'Rodyti praėjusius renginius','Contact:'=>'Susisiekite:','Resources:'=>'Ištekliai:','Click for more...'=>'Spauskite čia, jei norite sužinoti daugiau...','Save to your calendar'=>'Įtraukti į kalendorių','Cancelled'=>'Atšaukta','The legacy parser option is deprecated and will be removed in a future update.'=>'Senasis analizatoriaus parinktis yra pasenęs ir bus pašalintas ateityje atnaujinant programą.','Print'=>'Spausdinti','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Trumpasis kodas „currentweek“ yra pasenęs. Vietoj jo trumpajame kode naudokite view="week".','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Trumpasis kodas „legendinline“ yra pasenęs. Vietoj jo trumpajame kode naudokite legendstyle="inline".','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s atnaujino %2$s%3$s kalendorių teikimą priekiniuose puslapiuose. Jei jūsų svetainė naudoja talpyklos papildinį, gali tekti išvalyti talpyklą.','%1$s has %2$spaused%3$s 