 jūsų URL buvo paverstas spustelėjamuoju saitu. Dėl to jūsų kalendorius gali būti rodomas netinkamai. Prašome pašalinti spustelėjamąjį saitą iš trumpojo kodo.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcija r34ics_url_get_contents() nebėra palaikoma.','Add %1$s'=>'Pridėti %1$s','Close'=>'Uždaryti','ICS Feed URL:'=>'ICS kanalo URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Įsitikinkite, kad naudojate %1$sprenumeratos%2$s URL, o ne %3$sinterneto peržiūros%4$s URL.%5$s (Įvedus URL tiesiogiai į savo interneto naršyklę, turėtų būti atsisiųstas %6$s failas.)','Calendar Title:'=>'Kalendoriaus pavadinimas:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Palikite tuščią, jei norite naudoti kalendoriaus numatytąjį pavadinimą. Įveskite %1$s, jei norite visiškai praleisti pavadinimą.','Calendar Description:'=>'Kalendoriaus aprašymas:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Palikite tuščią, jei norite naudoti kalendoriaus numatytąjį aprašymą. Įveskite %1$s, jei norite visiškai praleisti aprašymą.','View:'=>'Žiūrėti:','month'=>'mėnesį','list'=>'sąrašas','week'=>'savaitė','Count:'=>'Kiekis:','Format:'=>'Formatas:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Palikite %1$s tuščią, kad būtų įtraukti visi būsimi renginiai. %2$s turi būti standartinis %3$sPHP datos formato stygas%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Rodyti renginių aprašymus %1$s(įterptame trumpojo kodo skaičiuje pakeiskite žodžių skaičių, kurį norite nustatyti)%2$s','Show event locations %1$s(if available)%2$s'=>'Rodyti renginių vietas %1$s(jei yra)%2$s','Show event organizers %1$s(if available)%2$s'=>'Rodyti renginio organizatorius %1$s(jei yra)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sPastaba:%2$s Papildomos %3$srodymo parinktys%4$s yra prieinamos rankiniu būdu redaguojant trumpąjį kodą po įterpimo.','Insert %1$s'=>'Įterpti %1$s','Do even more with %1$s version 6!'=>'Padarykite dar daugiau su %1$s 6 versija!','Calendar Builder + Block Editor'=>'Kalendoriaus kūrėjas + blokų redaktorius','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Konfigūruokite visus kalendoriaus nustatymus naudodami paprastą vizualią sąsają ir naudokite naują %1$s bloką, kad išskleidžiamajame meniu bloko redaktoriuje pasirinkite išsaugotus kalendorius – nereikia jokio trumpo kodo! %2$sSužinokite daugiau...%3$s','Additional Views and Enhanced Features'=>'Papildomi vaizdai ir patobulintos funkcijos','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s siūlo daug naujų kalendoriaus rodymo būdų, įskaitant integraciją su populiariomis %2$s ir %3$s atviro kodo bibliotekomis. Mėnesio ir metų peržiūros su šonine juosta pasirinktam dienai. „Up Next“ puikiai tinka radijo ar televizijos stočių programoms. Valdiklis ir metų prieinamumas puikiai tinka atostogų užsakymams. Be to, pagrindinėms peržiūroms „Mėnesis“, „Pagrindinė“, „Sąrašas“ ir „Savaitė“ pridėta papildomų funkcijų. %4$sPeržiūrėti pavyzdinius kalendorius...%5$s','Customization'=>'Pritaikymas','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Lengvai naudojami įrankiai, leidžiantys visiškai pritaikyti kalendoriaus spalvas, šriftą ir kitus parametrus. Pasirinkite vieną iš mūsų iš anksto nustatytų spalvų paletės arba sukurkite savo, naudodami galimybes individualiai pritaikyti kiekvieno kalendoriaus elemento spalvą. Pasirinkite iš teminių šriftų, sistemos šriftų arba daugiau nei 20 įtrauktų atvirojo kodo šriftų. %1$sSužinokite daugiau...%2$s','ICS Events'=>'ICS renginiai','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Paverčia %1$s į pilną kalendoriaus valdymo sistemą. Kurkite ir redaguokite naujus įvykius tiesiogiai WordPress sistemoje ir netgi integruokite juos su esamais išoriniais ICS srautais. %2$sSužinokite daugiau...%3$s','Localized Admin Interface'=>'Lokalizuota administratoriaus sąsaja','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Visos %1$s administratoriaus puslapiai yra išversti į dešimtis kalbų, įskaitant anglų, čekų, danų, vokiečių, graikų, ispanų, estų, suomių, prancūzų, vengrų, italų, japonų, korėjiečių, lietuvių, latvių, norvegų, olandų, lenkų, portugalų, rumunų, rusų, slovakų, serbų, švedų, turkų, ukrainiečių ir kinų.','Visit %1$s to learn more.'=>'Apsilankykite %1$s, kad sužinotumėte daugiau.','Calendar Builder screenshot'=>'Kalendoriaus kūrėjo ekrano kopija','Appearance screenshot'=>'Išvaizdos ekrano kopija','Available now!'=>'Dabar galima įsigyti!','Get %1$s!'=>'Gaukite %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Plati spalvų paletė ir tipografijos parinktys yra prieinamos su %1$s. %2$sSužinokite daugiau%3$s','Color Palette'=>'Spalvų paletės parinktys','Match calendar color palette to current Block Theme colors'=>'Suderinkite kalendoriaus spalvų paletę su dabartinėmis „Block Theme“ spalvomis.','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Pakeičia %1$s numatytąją neutralią spalvų paletę artimiausiais atitikmenimis iš dabartinės svetainės redaktoriaus stilių spalvų paletės arba %2$s failo jūsų temoje. Spalvų pasirinkimas yra algoritminis, todėl kai kurie deriniai gali neatitikti prieinamumo kontrasto reikalavimų. Šis nustatymas neveikia, jei naudojate „klasikinę“ temą, kurioje nėra %3$s failo.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sŠiuo metu tai yra beta funkcija.%2$s Norint pasiekti optimalų vaizdą, gali prireikti atlikti keletą kalendoriaus išvaizdos arba CSS pakeitimų, ypač jei jūsų srautai yra pažymėti spalvomis. Funkcionalumas gali keistis.','Dark mode'=>'Tamsus režimas','Inverts color palette (light colors on a dark background).'=>'Apverčia spalvų paletę (šviesios spalvos ant tamsaus fono).','Save Changes'=>'Išsaugoti pakeitimus','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Dėkojame už %1$s įdiegimą. Prieš kurdami pirmąjį kalendoriaus trumpąjį kodą, apsilankykite %2$sBendrieji nustatymai%3$s puslapyje ir patikrinkite, ar jūsų svetainės kalba, laiko juosta ir datos/laiko formato nustatymai yra teisingi. Daugiau informacijos rasite mūsų %4$sVartotojo vadove%5$s.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Pradėkite nuo %1$s keturiais paprastais žingsniais... ir jau baigėte pirmąjį žingsnį! Likusią informaciją rasite mūsų %2$sGreitojo pradžios vadove%3$s.','Quick Start Guide'=>'Greito pasirengimo darbui vadovas','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Išsami %1$svartotojo vadovas%2$s yra prieinamas mūsų svetainėje. Toliau pateikiami greiti nuorodos į pagrindinius dokumentacijos išteklius.','General:'=>'Bendros:','General WordPress Settings'=>'Bendrieji WordPress nustatymai','%1$s Settings'=>'%1$s Nustatymai','Working with Shortcodes:'=>'Darbas su trumpais kodais:','Shortcode Overview'=>'Trumpųjų kodų apžvalga','Shortcode Builder'=>'Trumpųjų kodų kūrėjas','Shortcode Parameters Reference'=>'Trumpųjų kodų parametrų nuorodos','Advanced Topics:'=>'Išplėstinės temos:','FAQs and Tips'=>'Dažnai užduodami klausimai ir patarimai','CSS Guide'=>'CSS vadovas','Developer Resources'=>'Kūrėjų ištekliai','GDPR'=>'BDAR','Loading'=>'Kraunasi','Always use AJAX to render calendars'=>'Kalendoriams atvaizduoti visada naudokite AJAX','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'AJAX įkėlimas dabar vyksta automatiškai. Prireikus galite pakeisti AJAX, pridėdami %1$s prie savo trumpojo kodo.','Increase memory limit when rendering calendars'=>'Padidinti atminties ribą, kai atvaizduojami kalendoriai','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Jei kalendorius neįkeliama ir rodo kritinę klaidą „out of memory“ (trūksta atminties), pabandykite padidinti atminties ribą. Rekomenduojama mažiausiai 512 MB. %1$s Pastabos: 1) Kai kurie prieglobos paslaugų teikėjai gali neleisti programoms pakeisti serverio numatytųjų nustatymų. 2) Šios parinkties negalima nustatyti mažesnės nei dabartinė numatytoji atminties riba jūsų serveryje.','deprecated'=>'nebereikalingas','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Kai kurie serveriai gali nepalaikyti numatytojo informacijos srauto užklausos metodo. Jei jūsų informacijos srautai neatsisiunčia, įjunkite šią parinktį, kad būtų naudojamas senasis užklausos metodas. Ši funkcija yra pasenusi ir bus pašalinta būsimame atnaujinime.','Default shortcode'=>'Numatytasis trumpasis kodas','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Jei jūsų svetainėje bus daug panašiai sukonfigūruotų kalendoriaus trumpųjų kodų, čia galite įvesti numatytąjį „bazinį“ trumpąjį kodą su parametrais, kurie turėtų būti vienodi visiems kalendoriams. Tada atskiri trumpieji kodai svetainėje gali apimti tik parametrus, kurie yra unikalūs tam kalendoriui, pavyzdžiui: %1$s Visi parametrai, įtraukti į atskirą trumpąjį kodą, pakeis čia nustatytus parametrus.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Leisti prieigą prie šių hostų vardų, kurie išsprendžiami į rezervuotus IP adresus','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Jei jūsų kalendoriaus serveris yra talpinamas tame pačiame fiziniame serveryje kaip ir jūsų svetainė, yra to paties vietinio tinklo dalis arba kitaip naudoja %1$srezervuotą IP adresą%2$s, įveskite jo vardą čia, kad leistumėte prieigą. Jei turite kelis kalendoriaus serverius, įveskite po vieną vardą kiekvienoje eilutėje. Daugiau informacijos rasite %3$s%4$s dokumentacijoje%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Įveskite vieną hostname į kiekvieną eilutę. Hostnames yra bazinis domeno vardas, o ne pilnas URL. %1$s Pavyzdžiui, įveskite %2$s, o ne %3$s.','Allow access to these ports'=>'Leisti prieigą prie šių prievadų','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress automatiškai leidžia prieigą prie 80, 443 ir 8080 prievadų. Jei jums reikia prieigos prie šaltinio kalendorių, kurie naudoja nestandartinius prievadus, įveskite prievadų numerius čia, atskirdami juos kableliais.','Caching'=>'Kaupimas','Transient (cache) expiration'=>'Laikinas (kešio) galiojimo pabaiga','seconds'=>'sekundės','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Nustato, kiek laiko kalendoriaus duomenys turi būti laikomi serverio talpykloje (WordPress transients) prieš perkraunant. Numatytasis nustatymas yra 3600 (1 valanda). Mažiausia leidžiama vertė yra 120 (2 minutės).','Admin'=>'Administratorius','Minimum access role'=>'Minimali prieigos funkcija','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Nustato minimalų vartotojo vaidmenį, kuriam leidžiama naudotis %1$s administratoriaus puslapiais. Tam tikros sritys, pvz., „Nustatymai“, yra dar labiau apribotos ir prieinamos tik %2$s vartotojams (%3$s vartotojams daugiafunkcinėse konfigūracijose).','Register Customizer'=>'Registruokite pritaikymo priemonę','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress nebeįtraukia nuorodos į „Customizer“ („Išvaizda“ meniu), kai aktyvi „Block Theme“ („Blokų tema“). Pažymėkite šį langelį, jei norite naudoti „Customizer“, pvz., papildomam CSS įvesties laukui. Pastaba: kai kurios temos ar papildiniai gali jau būti užregistravę „Customizer“, tokiu atveju šis nustatymas neturės jokio poveikio. (Pažymėtas langelis įjungia „Customizer“, o nepažymėtas – išjungia.','Remove "Add ICS Calendar" button in Classic Editor'=>'Pašalinti mygtuką „Pridėti ICS kalendorių“ klasikinėje redagavimo versijoje','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Pagal numatytuosius nustatymus, naudojant klasikinį redaktorių, ICS kalendorius įrankių juostoje virš WYSIWYG redaktoriaus prideda mygtuką „Pridėti ICS kalendorių“. Pažymėkite šį langelį, jei norite pašalinti mygtuką. Tai neturi įtakos svetainėms, kuriose naudojamas blokų redaktorius (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versijoje 10.6 įvestos naujos kelių trumpųjų kodų parametrų numatytosios reikšmės. Naujos instaliacijos automatiškai naudoja naujas numatytąsias reikšmes, tačiau atnaujintos instaliacijos toliau naudos senąsias numatytąsias reikšmes, jei nebus pažymėtas šis langelis. Daugiau apie šiuos pakeitimus skaitykite %2$smūsų tinklaraštyje%3$s.','User Guide'=>'Naudotojo žinynas','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Mūsų išsamus vartotojo vadovas yra prieinamas su pilnu vertimu į dešimtis kalbų mūsų svetainėje:','For assistance, please use our %1$ssupport request form%2$s.'=>'Jei reikalinga pagalba, prašome naudoti mūsų %1$spagalbos užklausos formą%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Kreipdamiesi į pagalbos tarnybą, pridėkite %1$ssistemos ataskaitą%2$s iš šio puslapio.','Spread the word!'=>'Paskleiskite žinią!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Jei manote, kad %1$s yra naudinga, galite padėti mums toliau augti ir tobulėti, palikdami %2$spenkių žvaigždučių atsiliepimą%3$s. Dėkojame!','Calendar Status: %1$sPaused%2$s'=>'Kalendoriaus būsena: %1$sPauzė%2$s','Calendar Status: %1$sActive%2$s'=>'Kalendoriaus būsena: %1$sAktyvus%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Naudokite pauzės mygtuką, jei reikia laikinai išjungti %1$s savo priekinėse puslapiuose.','Resume Calendars'=>'Atnaujinti kalendorius','Pause Calendars'=>'Pauzės kalendoriai','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Turinys nebus keičiamas, tačiau jūsų kalendoriai bus paslėpti ir %1$s išteklių failai (JavaScript, CSS) nebus įkelti į priekinės dalies puslapius. Jei naudojate kešavimą per įskiepį arba per savo prieglobos paslaugų teikėją, po šio parametro pakeitimo gali tekti išvalyti kešą.','%1$s Data Cache'=>'%1$s Duomenų talpykla','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Tai iš karto išvalys visus esamus kalendoriaus duomenis iš talpyklos (ištrins laikinuosius duomenis) ir privers WordPress iš naujo įkelti visus kalendorius, kai jie bus peržiūrimi kitą kartą. Tada talpyklos veikimas bus atnaujintas kaip anksčiau.','Clear Cached Calendar Data'=>'Išvalyti kalendoriaus duomenų talpyklą','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Jei naudojate trečiosios šalies kešavimo įskiepį, po šio įrankio paleidimo gali tekti išvalyti visos svetainės kešą.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Ar esate tikri? Tai atstatys visus %1$s nustatymus į numatytuosius. Jūsų išsaugotos kalendoriaus konfigūracijos ir trumpieji kodai bus išsaugoti, tačiau numatytųjų nustatymų atstatymas gali pakeisti kalendorių išvaizdą. Jei naudojate trečiosios šalies talpyklos įskiepį, po šio įrankio paleidimo gali tekti išvalyti visos svetainės talpyklą.','Only clear transients (default)'=>'Tik aiškūs pereinamieji reiškiniai (numatyta)','Also clear all saved ICS feed URLs'=>'Taip pat ištrinkite visas išsaugotas ICS kanalo URL adresus.','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Atkurti %1$svisus%2$s %3$s nustatymus (įskaitant laikinuosius ir tiekimo URL)','Last cleared:'=>'Paskutinis išvalymas:','never'=>'niekada','ICS Feed URL Tester'=>'ICS tiekimo URL testuotojas','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Jei nerimaujate, kad įskiepis netinkamai gauna jūsų informacijos srautą, galite patikrinti URL adresą čia.','Enter feed URL...'=>'Įveskite pašto URL...','Test URL'=>'Testo URL','Results:'=>'Rezultatai:','%1$s received.'=>'%1$s gauta.','This appears to be a valid ICS feed URL.'=>'Tai atrodo esąs galiojantis ICS tiekimo URL.','unknown'=>'nežinoma','This does not appear to be a valid ICS feed URL.'=>'Tai neatrodo kaip galiojantis ICS srauto URL.','Could not retrieve data from the requested URL.'=>'Nepavyko gauti duomenų iš prašomo URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Bandant gauti prašomą URL adresą įvyko nežinoma klaida.','Please copy the following text and include it in your message when emailing support.'=>'Prašome nukopijuoti šį tekstą ir įtraukti jį į savo žinutę, kai rašote laišką pagalbos tarnybai.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Taip pat įtraukite trumpą kodą %1$s tiksliai taip, kaip jį įvedėte atitinkamame puslapyje.','No events found.'=>'Renginių nerasta.','Previous Page'=>'Ankstesnis puslapis','Next Page'=>'Kitas puslapis','All Day'=>'Visą dieną','Previous Month'=>'Ankstesnis mėnuo','Next Month'=>'Kitas mėnuo','Today'=>'Šiandien','Month selection'=>'Mėnesio pasirinkimas','No events.'=>'Nėra įvykių.','No additional events this month.'=>'Šį mėnesį nėra papildomų renginių.','Week selection'=>'Savaitės pasirinkimas','Last week'=>'Paskutinė savaitė','This week'=>'Šią savaitę','Next week'=>'Kita savaitę','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Paversti savo „Google“ kalendorių, „Microsoft Office 365“ arba „Apple iCloud“ kalendorių į sklandžiai integruotą, automatiškai atnaujinamą ir priežiūros nereikalaujančią „WordPress“ patirtį.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
